    element_at(array_sort(array_agg(CASE WHEN custom_kyc_event_version is not null then struct(ocurred_on, custom_kyc_event_version) else NULL end), (left, right) -> case when left.ocurred_on < right.ocurred_on then 1 when left.ocurred_on > right.ocurred_on then -1 when left.ocurred_on == right.ocurred_on then 0 end), 1).custom_kyc_event_version as custom_kyc_event_version,
